?><p style="font-family: Arial, Verdana, sans-serif; font-size: 12px; text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Этот часовой бренд зародился совсем недавно, в 1999 году. Но, несмотря на это, создатель бренда Итало Фонтана, целых 7 лет трудился над своей первой моделью часов. Справедливости ради, стоит отметить, что сама идея изготовления этих часов принадлежала не самому создателю, а его деду. Во время Второй Мировой войны, компания, которая принадлежала Иво Фонтане, производила практически все оборудование для итальянского флота. На тот момент, компания предлагала поистине инновационные разработки, которые не встречались ни в одном флоте мира. И вот, в 1999 году, Итало Фонтана нашел чертежи своего деда, и решил поменять «производственную ориентацию». До этого, Итало производил исключительно одежду, но, после этого, он создал компанию, производящую высококачественные часы. Оригинальный дизайн, механизмы и детали высокого качества, люминесцентный циферблат, необычные корпуса – все эти детали, делают часы&nbsp;<span lang="EN-US">U</span>-<span lang="EN-US">Boat</span><span lang="EN-US">&nbsp;</span>все более и более популярными во всем мире.</span></span></p>

